// Şehir kodlarını isimlerle eşleştirmek için yardımcı fonksiyon
export const getCityNameByCode = (code: string): string => {
  const city = cityPaths.find(city => city.code === code || city.id === `TR${code.padStart(2, '0')}`);
  return city ? city.name : `Şehir ${code}`;
};

// Şehir ismini koda çevirmek için yardımcı fonksiyon
export const getCityCodeByName = (name: string): string => {
  const city = cityPaths.find(city => city.name.toLowerCase() === name.toLowerCase());
  return city ? city.code : '';
};
